import "./App.css";

function Footer() {
  return (
    <>
      <footer class="container-md d-flex flex-wrap justify-content-between align-items-center py-4 border-top navbar-custom">
        <div class="col-md-4 d-flex align-items-center">
          <span class="mb-3 mb-md-0 ">2023 Movie Rater</span>
        </div>
        <ul class="nav col-md-4 justify-content-end list-unstyled d-flex">
          <li class="ms-3 text-muted">use the tmdb</li>
          <li class="ms-3">fd</li>
          <li class="ms-3"></li>
        </ul>
      </footer>
    </>
  );
}

export default Footer;
